rgot the name. It\\'s strange, noone remembers the name. However, we found the dead body in the cell. It should be already buried beside the chapel. Clean the cell for our next guest!\\n\\nCell 5: \\nIt wasn\\'t us. This guy was in that - undead - state when we caught him. Since then we saw pirates at our coast...and skeletons like him. Keep him locked in his cell! The pirates are no problem for us.\\n\\nWhat was this? Did he try to talk to Morana? Hm, I guess I spent too much time here...',},['Z']=69637.515745,['X']=96978.360153,['SizeX']=46.456456,},[89]={['Roll']=0,['Id']=2007,['EffectType']=7,['SizeX']=60,['Pitch']=3.054326,['Contrast']=1,['Groups']=0,['Color']=758699,['Alpha']=1,['Yaw']=0.082030,['SizeZ']=80,['SizeY']=80,['Z']=69679.326083,['X']=96975.561236,['Y']=29978,},[90]={['Roll']=0,['Yaw']=2.860595,['Id']=2008,['EffectType']=4408,['Y']=30127,['Pitch']=0,['Contrast']=1,['Groups']=0,['Color']=555299,['Alpha']=0.920000,['SizeZ']=34,['SizeY']=34,['MetaData']={['message']='1',},['Z']=70191.367590,['X']=96303.104107,['SizeX']=18,},[91]={['Roll']=0,['Yaw']=2.860595,['Id']=2009,['EffectType']=4408,['Y']=30127,['Pitch']=0,['Contrast']=1,['Groups']=0,['Color']=555299,['Alpha']=0.920000,['SizeZ']=34,['SizeY']=34,['MetaData']={['message']='2',},['Z']=70127.491536,['X']=95805.722102,['SizeX']=18,},[92]={['Roll']=0,['Yaw']=1.464331,['Id']=2011,['EffectType']=4408,['Y']=30128,['Pitch']=0,['Contrast']=1,['Groups']=0,['Color']=555299,['Alpha']=0.920000,['SizeZ']=34,['SizeY']=34,['MetaData']={['message']='3',},['Z']=69870.799739,['X']=95608.812249,['SizeX']=18,},[93]={['Roll']=0,['Yaw']=0.225147,['Id']=2012,['EffectType']=4408,['Y']=30128,['Pitch']=0,['Contrast']=1,['Groups']=0,['Color']=555299,['Alpha']=0.920000,['SizeZ']=34,['SizeY']=34,['MetaData']={['message']='4',},['Z']=69677.710977,['X']=95864.243606,['SizeX']=18,},[94]={['Roll']=0,['Yaw']=6.068510,['Id']=2013,['EffectType']=4408,['Y']=30127,['Pitch']=0,['Contrast']=1,['Groups']=0,['Color']=555299,['Alpha']=0.92000