R["oh__@figmentpigment"]="{['na']={[16]={['N']='The Gilded Mammoth',['O']=18819,['C']=1.051000,['D']='Traditional Breton bar lined with a roaring fireplace and upright wooden piano, with live music performances most evenings.',},[81]={['N']='Alpine Springs Lodge',['O']=18812,['C']=1.022000,['D']='Our healing springs are temporarily open to the public--all are welcome to celebrate the winter holiday with us! Dinner is provided once a day in the great hall. Guests with donations of gold or food for the feasts are welcome to spend the night in the sleeping quarters upstairs. Any guests who wish to drink the mineral water for their health visit the old fountain to the right of the bathing pools; speak with our housekeeper if you need any assistance.',},[2]={['N']='Bremusa\\'s Room',['O']=18408,},[19]={['N']='Vampiric Chapel',['O']=18900,['C']=1.023000,['D']='',},[4]={['N']='Cake Shop',['O']=18408,},[36]={['N']='Smugglers Base',['O']=18812,['C']=1.018000,['D']='Crumbling, abandoned house converted into the base for an Argonian smuggling ring. Enter through the front door and climb the mushrooms to access the main hub, or slip through the fence to the left for an easier route (just .. watch your step). Two hidden portals: one tucked inside a hidden escape route in case of raids, and the other alongside a sunken seaside treasure trove. If you have time for a swim, there are diving boards on top of the lookout tower and the wall.',},[22]={['N']='Sereyne\\'s Tea House',['O']=18819,['C']=1.024000,['D']='Cozy tea and cake shop located just outside of Senchal.',},[7]={['N']='Nihelenia\\'s Lab',['O']=18417,},[10]={['N']='Black Marsh Base',['O']=18513,},[9]={['N']='Amusement Park',['O']=18812,['C']=1.016000,['D']='Tamriel\\'s first park designed to the refined standards of the Altmer! Novelty souvenirs, refreshments, and water closets are available by the gates. Around the park grounds you\\'ll find an enchanted carousel, barbaric swinging ship, and the Clockwork cog-spinner! Our main hall currently hosts a journey over the sea to sample the cultural highlights of Elsweyr; our Dragonguard sponsors ask that you spare a moment for the exhibits on their current trials as you pass through the queue.',},[58]={['N']='Kotyonok\\'s Suite',['O']=18408,},[34]={['N']='Summershade',['O']=18408,},[28]={['N']='Craftsman Lodge',['O']=18823,},[26]={['N']='Mage\\'s Library',['O']=18552,},[78]={['N']='Proudspire Manor',['O']=18916,},[6]={['N']='Blood Bar',['O']=18900,},},['Version']=1764,['TS']=1634424258,['Key']='oh__@figmentpigment',}"
