ta']={['target effect']=1425,},['Yaw']=1.570796,['Z']=97107,['Groups']=0,['Contrast']=1.400000,['EffectType']=914,['Alpha']=0.860000,['SizeZ']=2280,['Color']=494949,['Roll']=0,},[18]={['X']=17107,['Y']=25549,['Pitch']=0,['Id']=1427,['SizeX']=2620,['SizeY']=2620,['MetaData']={['target effect']=1425,},['Yaw']=1.570796,['Z']=96961,['Groups']=0,['Contrast']=1,['EffectType']=914,['Alpha']=1,['SizeZ']=2620,['Color']=494949,['Roll']=0,},[19]={['X']=20955,['Y']=26206,['Pitch']=0,['Id']=1430,['SizeX']=2740,['SizeY']=1000,['MetaData']={['furniture']='4637672198362283213',},['Yaw']=4.712389,['Z']=101203,['Groups']=0,['Contrast']=1,['EffectType']=1004,['Alpha']=1,['SizeZ']=1000,['Color']=494949,['Roll']=0,},[20]={['X']=30581,['Y']=21614,['Pitch']=4.712564,['Id']=1432,['SizeX']=166.456456,['SizeY']=170,['MetaData']={['title']='Warnung/ Warning',['message']='Es war so friedlich als ich hier ankam. Dann kam ER. Als er sich dieses Heim ansah, rief er: \"laaaangweilig!\" und sagte, dass sich Shalidor nicht vor ihm verstecken könne. Er werde seine Erinnerungen an die guten alten Zeiten auffrischen. Ich weiß zwar nicht, was das bedeutet, aber Ihr solltet vorsichtig sein.\\n\\nEr hat auch den Becher mit Wein und den Käse dorthin gestellt. Ich weiß nicht, warum.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nIt was so peaceful when I arrived here. Then HE appeared. When he looked at this home he called: \"booooring!\" and said that Shalidor could not hide from him. He would refresh his memory of the good old times. I don\\'t know what that means, but you should be careful.\\n\\nHe also put the cup of wine and the cheese there. I don\\'t know why. ',},['Yaw']=1.570796,['Z']=98008,['Groups']=0,['Contrast']=1,['EffectType']=8503,['Alpha']=1,['SizeZ']=170,['Color']=102439,['Roll']=0,},[21]={['Y']=21626,['Pitch']=1.570971,['Id']=1433,['X']=30575,['SizeX']=100,['SizeY']=100,['Yaw']=1.570796,['Z']=98027,['Groups']=0,['Contrast']=2.700000,['EffectType']=7,['Alpha']=0.860000,['SizeZ']=100,['Color']=649599,['Roll']=0,},[22]={['X']=27502,['Y']=18887,['Pitch']=0,['Id']=1435,['SizeX']=2280,['SizeY']=1000,['MetaData']={['furniture']='4637672198362211358',},['Yaw']=4.712389,['Z']=97404,['Groups']=0,['Contrast']=1,['EffectType']=1005,['Alpha']=1,['SizeZ']=1000,['Color']=494949,['Roll']=0,},[23]={['Y']=19733,['Pitch']=1.570971,['Id']=1437,['X']=22796,['SizeX']=100,['SizeY']=100,['Yaw']=1.570796,['Z']=97101,['Groups']=0,['Contrast']=3,['EffectType']=7,['Alpha']=0.860000,['SizeZ']=100,['Color']=649599,['Roll']=0,},[24]={['X']=22808,['Y']=19709,['Pitch']=4.705408,['Id']=1438,['SizeX']=126.456456,['SizeY']=110,['MetaData']={['title']='Aua!',['message']='Das tat weh!\\n\\nIch habe schon einmal in den nächsten Raum geschaut. Er hat den Kopf eines Clannbann mit einer üppigen Verzierung an die Wand gehängt und dabei immer wieder \"Welpi-Mörder\" gemurmelt. \\n\\nAls sein Diener ihn daran erinnerte, dass er an Welpis Ende beteiligt war, verwandelte er ihn in einen Skamp und schnallte ihm einen Rucksack gefüllt mit \"aromatischem\" Käse um. Seitdem versucht sein Diener, dem Gestank zu entkommen - mit mäßigem Erfolg.  \\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nThat was painful!\\n\\nI took a look into the next room. He put the head of a clannfear with a huge decoration on the wall and murmured again and again \"Puppy-killer\". \\n\\nWhen his servant reminded him, that he was involved in Puppy\\'s ending, he transformed him into a scamp and strapped a backpack with \"aromatic\" cheese on him. Since then his servant tries to escape the smell - with modest success. \\n\\n',},['Yaw']=5.581563,['Z']=97099,['Groups']=0,['Contrast']=1,['EffectType']=8503,['Alpha']=1,['SizeZ']=110,['Color']=102439,['Roll']=0,},[25]={['Y']=18832,['Pitch']=1.563815,['Id']=1440,['X']=29505,['SizeX']=100,['SizeY']=100,['Yaw']=1.490511,['Z']=94379,['Groups']=0,['Contrast']=3.080000,['EffectType']=7,['Alpha']=0.860000,['SizeZ']=100,['Color']=649599,['Roll']=0,},[26]={['X']=29513,['Y']=18811,['Pitch']=4.974188,['Id']=1441,['SizeX']=66.456456,['SizeY']=70,['MetaData']={['title']='Oink!',['message']='Ihr solltet diesem seltsamen Stab nicht zu nahe kommen. Andere Leute, die ihn anschauen wollten, sind ... nicht mehr sie selbst. \\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nDon\\'t get too close to that strange stuff. Other people who wanted to take a look at it are ... not themselves anymore.',},['Yaw']=4.712389,['Z']=94398,['Groups']=0,['Contrast']=1,['EffectType']=8503,['Alpha']=1,['SizeZ']=70,['Color']=102439,['Roll']=0,},[27]={['Y']=25504,['Pitch']=4.712564,['Id']=1442,['X']=18958,['SizeX']=26.456456,['SizeY']=30,['Yaw']=1.748820,['Z']=97150,['Groups']=0,['Contrast']=1,['EffectType']=902,['Alpha']=1,['SizeZ']=30,['Color']=990089,['Roll']=0,},[28]={['Y']=25505,['Pitch']=1.570971,['Id']=1443,['X']=18958,['SizeX']=80,['SizeY']=80,['Yaw']=1.570796,['Z']=97157,['Groups']=0,['Contrast']=1,['EffectType']=7,['Alpha']=0.860000,['SizeZ']=80,['Color']=649599,['Roll']=0,},[29]={['Y']=22025,['Pitch']=1.570971,['Id']=1445,['X']=22434,['SizeX']=100,['SizeY']=100,['Yaw']=1.570796,['Z']=96656,['Groups']=0,['Contrast']=2.840000,['EffectType']=7,['Alpha']=0.860000,['SizeZ']=100,['Color']=649599,['Roll']=0,},[30]={['X']=22439,['Y']=22019,['Pitch']=4.708898,['Id']=1446,['SizeX']=66.456456,['SizeY']=70,['MetaData']={['title']='Applaus!',['message']='Verehrtes Publikum! \\n\\nIhr seht heute die berühmte, einzigartige und geniale Tramödie des Meisters! \\n\\nEr wird nur immer traurig, wenn das Stück sich seinem Ende nähert. Daher könnte es sein, dass er das Stück nochmal aufführt. \\n\\nBöse Zungen behaupten, dass ihm die Darsteller ausgehen und Teile des Publikums während der Aufführung an Altersschwäche gestorben wären ... aber das ist nicht wahr!\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nLadies and Gentlemen! \\n\\nToday you\\'ll see the famous, unique and ingenious tromedy of the master! \\n\\nHe just gets sad when play approaches the end. So it could happen, that he starts the play again. \\n\\nSharp tongues say that he\\'s running out of actors and parts of the audience died during the play because of senile decay ... but that is not true!',},['Yaw']=5.235988,['Z']=96644,['Groups']=0,['Contrast']=1,['EffectType']=8502,['Alpha']=1,['SizeZ']=70,['Color']=102439,['Roll']=0,},[31]={['Y']=22019,['Pitch']=1.570971,['Id']=1449,['X']=20906,['SizeX']=80,['SizeY']=80,['Yaw']=1.570796,['Z']=101333,['Groups']=0,['Contrast']=1,['EffectType']=7,['Alpha']=0.860000,['SizeZ']=80,['Color']=649599,['Roll']=0,},[32]={['X']=20896,['Y']=21987,['Pitch']=4.625123,['Id']=1450,['SizeX']=86.456456,['SizeY']=70,['MetaData']={['title']='Bye bye',['message']='Wirf einfach den falschen Gast aus dem Haus, um deine Ferienwohnung zu beziehen.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nJust throw out the false guest and you can move into your holiday home.',},['Yaw']=2.007129,['Z']=101369,['Groups']=0,['Contrast']=1,['EffectType']=8503,['Alpha']=1,['SizeZ']=70,['Color']=102439,['Roll']=0,},[33]={['Y']=23076,['Pitch']=1.570971,['Id']=1451,['X']=20171,['SizeX']=100,['SizeY']=100,['Yaw']=1.570796,['Z']=101741,['Groups']=0,['Contrast']=2.750000,['EffectType']=7,['Alpha']=0.860000,['SizeZ']=100,['Color']=649599,['Roll']=0,},[34]={['X']=20175,['Y']=23067,['Pitch']=4.660029,['Id']=1452,['SizeX']=66.456456,['SizeY']=70,['MetaData']={['title']='Miau!',['message']='Er ist völlig fasziniert von dieser Alfiq. Als er in der Gestalt eines Alfiq war, wurde er von seiner Sucht nach Milch besiegt. Dieses Exemplar scheint jedoch völlig resistent dagegen zu sein ... interessant!\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nHe is completely fascinated of this alfiq. When he was in the shape of an alfiq, he was defeated by his addiction to milk. But this exemplar seems to be resistant to it ... interesting!',},['Yaw']=4.017748,['Z']=101733,['Groups']=0,['Contrast']=1,['EffectType']=8503,['Alpha']=1,['SizeZ']=70,['Color']=102439,['Roll']=0,},[35]={['Y']=28376,['Pitch']=1.570971,['Id']=1453,['X']=18909,['SizeX']=100,['SizeY']=100,['Yaw']=1.570796,['Z']=106905,['Groups']=0,['Contrast']=2.800000,['EffectType']=7,['Alpha']=0.860000,['SizeZ']=100,['Color']=649599,['Roll']=0,},[36]={['X']=18913,['Y']=28360,['Pitch']=4.691445,['Id']=1454,['SizeX']=126.456456,['SizeY']=70,['MetaData']={['title']='Aaaaaah!',['message']='Ihm gelüstet nach einer neuen Herausforderung. \\n\\nWer durch das Mondtor springt, bekommt hervorragenden Wein und Käse. \\n\\nWer nicht springt, wird seine langandauernden Ferien hier verbringen und Schmetterlinge jagen und unheimlich glücklich sein. \\n\\nDie Wahl ist doch einfach, oder? Was werdet ihr tun?\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nHe craves for a new challenge. \\n\\nThose who jump through the moongate will get outstanding wine and cheese. \\n\\nThose who don\\'t jump will spend their long-lasting holidays here and hunt butterflies and be incredibly happy. \\n\\nIt\\'s an easy choice, isn\\'t it? What will you do?\\n',},['Yaw']=3.141593,['Z']=106905,['Groups']=0,['Contrast']=1,['EffectType']=8503,['Alpha']=1,['SizeZ']=70,['Color']=102439,['Roll']=0,},[37]={['Y']=23476,['Pitch']=0,['Id']=1455,['X']=19404,['SizeX']=100,['SizeY']=100,['Yaw']=0.153589,['Z']=98695,['Groups']=0,['Contrast']=2.160000,['EffectType']=888,['Alpha']=0.540000,['SizeZ']=100,['Color']=323765,['Roll']=0,},[38]={['Y']=23237,['Pitch']=6.258751,['Id']=1456,['X']=19510,['SizeX']=100,['SizeY']=100,['Yaw']=6.174975,['Z']=100062,['Groups']=0,['Contrast']=2.160000,['EffectType']=888,['Alpha']=0.580000,['SizeZ']=100,['Color']=323765,['Roll']=0,},[39]={['Y']=19057,['Pitch']=0,['Id']=1457,['X']=28716,['SizeX']=400,['SizeY']=1000,['Yaw']=4.974188,['Z']=96288,['Groups']=0,['Contrast']=3.180000,['EffectType']=3,['Alpha']=0.990000,['SizeZ']=1000,['Color']=992481,['Roll']=0,},[40]={['Y']=18884,['Pitch']=5.946337,['Id']=1461,['X']=31165,['SizeX']=293,['SizeY']=290,['Yaw']=4.885177,['Z']=9